import React from 'react';
import { useNavigate } from 'react-router-dom';

function Header() {
    const handleEnter = () => {useNavigate('/');};

    return (
        <div className='HeaderBox'>
            <button className='HeaderContent' onClick={handleEnter}>Twenty4</button>
        </div>
    );
}
